import Layout from "../layouts/Layout";

import React from "react";

const Downloads = () => {
  return (
    <Layout>
      <main
        style={{
          height: "100vh",
          display: "flex",
          justifyContent: "stretch",
          alignItems: "center",
        }}
      >
        <h1
          style={{
            width: "100%",
          }}
        >
          Materia≈Çy do pobrania
        </h1>
      </main>
    </Layout>
  );
};

export default Downloads;
